import React, { Component ,Fragment} from 'react'


const UsersList = props => {
    return (
        <Fragment>

        <div className="container">


  <table className="table">
    <thead>
      <tr>
        <th>Id</th>
        <th>Name</th>
        <th>Email</th>
        <th>Age</th>
        <th>Company Name</th>
        <th>City</th>

      </tr>
    </thead>
    <tbody>
      {userList.map(({id,age,first_name,company_name,city,email}, index) => {
        return (
      <tr key={index}>

        <td>{id}</td>
        <td>{first_name}</td>
        <td>{email}</td>
        <td>{age}</td>
        <td>{company_name}</td>
        <td>{city}</td>

      </tr> 
        )
      })}


    </tbody>
  </table>

</div>

        </Fragment>
    );
}
export default UsersList;
